import React, { Component } from "react";
import ClaimService from "../service/ClaimService";


export class GetClaimById extends Component{
    constructor(props){
        super(props);
        this.state = {
            claims: []
        }
    }
    
    componentDidMount(){
        
        ClaimService.getClaimById(this.props.match.params.Id).then ((res) =>{
            console.log(res.data);
            this.setState({claims : res.data});
        })
    }
   
    render(){
        return(
            <><h2 className="text-center">Claim List</h2>
                        <div className="row-plan">
                <table className="table table-striped table-bordered">
                        <tr>
                            <th>Plan Id</th>
                            <td>{this.state.plans.planId}</td>
                        </tr>
                            <tr><th>Plan Name</th>
                            <td>{this.state.plans.planName}</td>
                        </tr>
                        <tr>
                            <th>Plan Start Date</th>
                            <td>{this.state.plans.planStartDate}</td>
                        </tr>
                        <tr>
                            <th>Plan End Date</th>
                            <td>{this.state.plans.planEndDate}</td>
                        </tr>
                        <tr>
                            <th>Plan Insured Amount</th>
                            <td>{this.state.plans.insuredAmount}</td>
                        </tr>                                               
                </table>
            </div></>      
            )
    }

}
